    defaultValue: defaultToDoData
  })

  const persistData = (data: DoNextData) => {
    // setData(data)
    setLocalStorage(data)
  }

  return (
    <div className="App">
      <RepeatingDos data={localStorage.todos} />
      <div>--------------------------------------------------------------</div>
      <Events/>
      <div>--------------------------------------------------------------</div>
    </div>
  )
}

export default App
